  description: |+
    ##What's the Jenkins Operator?
    
    Jenkins Operator is a Kubernetes native operator which fully manages Jenkins on Openshift. It was built with immutability and declarative configuration as code in mind.
    It is meant to replace the Jenkins on Openshift Template as the primary source of deploying Jenkins on Openshift (https://github.com/openshift/jenkins) while also easing the Operational work necessary to manage the Jenkins Instance(s) on an Openshift Cluster.


    Out of the box it provides:


    - Integration with Kubernetes

    - Pipelines as code

    - Extensibility via groovy scripts or configuration as code plugin

    - Security and hardening

    - Problem statement and goals

    The main reason why we decided to implement the Jenkins Operator is the fact that we faced a lot of problems with standard Jenkins deployment. We want to make Jenkins more robust, suitable for dynamic and multi-tenant environments.


    Some of the problems we want to solve:

    - Installing plugins with incompatible versions or security vulnerabilities

    - Better configuration as code

    - Lack of end to end tests

    - Handle graceful shutdown properly

    - Security and hardening out of the box

    - Orphaned jobs with no jnlp connection

    - Make errors more visible for end users

    - Backup and restore for jobs history

